import React, { Component } from 'react';
import './TestPage.css';

class TestPage extends Component {
  render() {
    return (

      <div className="wrap-subfooter">
        <div className="subfooter">
            <div> 
                    <a href="/write-for-us/" class="write-for"> Write for Us </a>
            </div>
        </div>
      </div>
    );
  }
}

export default TestPage;
